function Personal ({name, idade, profissao, src}) {
  return (
    <div>
      <h2>Nome: {name}</h2>
      <p>Idade: {idade}</p>
      <p>Profissao: {profissao}</p>
      <img src={src} alt="Imagem qualquer"/>
    </div>
  );
}

export default Personal;
